import React from 'react';
import styled from 'styled-components';
import Header from './Header';

const LayoutRoot = styled.div`
  display: flex;
`;

const Layout: React.FC = () => {
  return (
    <LayoutRoot>
      <Header />
    </LayoutRoot>
  );
};

export default Layout;
